import React from 'react';

export default function Contact() {
  return (
    <div className="container contact-card">
      <h2>Contact</h2>
      <p className="muted">Want to collaborate or see case studies? Reach out on LinkedIn or send an email.</p>
      <div className="contact-actions">
        <a className="btn btn-outline" href="mailto:your.email@example.com">Email</a>
        <a className="btn" href="https://www.linkedin.com/in/priyadharshini2214" target="_blank" rel="noreferrer">LinkedIn</a>
      </div>
    </div>
  );
}
